Semangat Pagi Pejuang Subuh.
Semangat semakin menggebu di hari Sabtu.
Jangan biarkan dirimu terus menggerutu.
Dan tetap jagalah Silaturahimmu.
Supaya hatimu tak membatu.

Jika kau temui kekurangan pada orang lain.
Maka jadikan ia sebagai ladang pahalamu.
Maafkan kesalahannya.
Doakan kesalahan Mereka.
Dna jagalah Aibnya.
Maka Allah juga akan selalu menjagamu.

Happy Weekend

